// ----------------- 辅助：安全读取体素 -----------------
#define MAPSIZE 32
#define MAPX 32
#define MAPY 32
#define MAPZ 32
__attribute__ ((section (".noinit"))) __attribute__ ((aligned (8))) uint8_t MAP[MAPX][MAPY][MAPZ];
static inline uint8_t getVoxel(int x, int y, int z) {
    if ((unsigned)x >= MAPSIZE || (unsigned)y >= MAPSIZE || (unsigned)z >= MAPSIZE) return 0;
    return MAP[x][y][z];
}

#endif // MAP_H
